h)\nBàn làm việc ⇒ 変 更 Change Bàn làm việc / Chất liệu Creation\n· Các hoạt động tuyển dụng\n· SỰ CỐ TAI NẠN ỨNG PHÓ (tai nạn / trường hợp tương ứng)\n· Đối phó với Deficience và Scandals (Installation · Xây dựng nợ)\n· Hưởng ứng Complarints khách hàng (khiếu nại)\n-Huấn luyện (chữa cháy / Khác) (đào tạo (lửa / khác))\n-Witness tại Start An ninh Đồn trú (tang vào lúc bắt đầu của chứng khoán thường trú)\n· COVID-19 báo cáo (báo cáo corona liên quan)\nKhác\n==> Hoàn thành 100%','\"ASM System Data Extraction\nAdded data extraction function as an item of attached document.\nReport type\nExtract \"Report\" by date search. \"\n\"Revision of user report\nAs below, change and write items of shards to user reports.\n· PATROL ⇒ 変更 Change Patrol / Education for Guards (Education for Plood / Security Members)\n· Meeting (Customer)\n· Security Guard / Post Disposition\nIn-House Meeting (Security Leader Meeting)\n· In-House Meeting (Area Leader Meeting)\n-In-House Meeting (Security Operations Manager Meeting) (SECURITY OPERATIONS MEETING)\n· INTERVIEW with Guards (interview with security members)\nDESK WORK ⇒ 変更 Change Desk Work / Material Creation\n· Recruitment Activities\n· INCIDENT ACCIDENT RESPONSE (accident / case correspondence)\n· Dealing with Deficience and Scandals (Installation · Debt Building)\n· Responding to Customer Complarints (complaints)\n-Training (Firefighting / Others) (training (fire / other))\n-Witness at the Start of Security Stationed (Mourning at the start of a resident security)\n· COVID-19 Report (corona related report)\nOthers\n==> Complete 100%','03',435,NULL,'2021-09-30 16:26:58'),(397,'P0003','2021-09-30 17:09:54','A0003','Project Inddto\r\n+ Fix Schedule not correct in some cases  (DONE)\r\nProject Hankyu Cal \r\n- Check and fix díplay logic on B-PC screen\r\n+ Check and fix section B9\r\n+ Check and fix section B10\r\n+ Check and fix section B11\r\n+ Check and fix section B12\r\n+ Check and fix section B13','プロジェクトInddto\r\n+修正スケジュールは正しくない場合がありませ